import { Link, useNavigate } from "react-router-dom";
import {useState, useEffect} from "react";
import Header from '../components/Header.js';

const url = 'http://34.124.232.186:5000/admin/users/';

function User( { user } ) {

    const [users, setUsers] = useState(null);
    const [currentUser, setCurrentUser] = useState(null);

    const containerStyle = {
        display: 'flex',
        flexDirection: 'row'
    }

    const buttonStyle = {
        backgroundColor: '#80a1e8',
        color: 'white',
        padding: 10,
        margin: 10,
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
    };

    const itemStyle = {
        flex: 1,
        textAlign: 'center',
        fontSize: '32px',
        borderStyle: 'solid',
        borderRadius: 10,
        borderColor: 'grey',
        margin: 15
    }

    useEffect(() => {
        const fetchData = async () => {
            let data = null;
            try {
                const response = await fetch(url, {
                    method: "GET",
                    headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json',
                    'Authorization': "Token " + user.token}});
                console.log(user.token);
                data = await response.json();
                console.log(data);
                setUsers(data.data);
            } catch (error) {
                console.error("Error fetching sample", error);
            } finally {

            }
        };

        if (user.user.is_superuser) {
            fetchData();
        }

        }, []);

    return (
        <div>
            <Header text={'Problem'}/>
            <div style={containerStyle}>
                <div style={itemStyle}>
                    <h1>Users</h1>
                    {users != null ? 
                    (users.map(user => {
                        return <div onClick={() => setCurrentUser(user)} style={currentUser.id == user.id ? {borderStyle: 'solid', borderColor: "#2424c7", borderRadius: 10, margin: 15} : {borderStyle: 'solid', borderRadius: 10, margin: 15}}>
                            <p style={{fontSize: '22px'}}>{user.username}</p>
                        </div>
                    })) : null}
                </div>

                <div style={itemStyle}>
                    {currentUser == null ? (<h1>No user selected</h1>) : (<div>
                        <h1>{currentUser.username}</h1>
                        <div>
                        <h2>User's Submissions</h2>
                        <div style={{display: 'flex', alignItems: 'stretch', fontSize: '20px'}} key={user.id}>
                                <div style={{margin: 5, flex: 1}}>
                                    <p>
                                        Username: {currentUser.username} <br/>
                                        Full name: {currentUser.first_name == null && currentUser.last_name == null ? "None" : currentUser.first_name + currentUser.last_name} <br/>
                                        Email: {currentUser.email}
                                    </p>
                                </div>
                                <div style={{margin: 5, flex: 1}}>
                                    <p>
                                        Verified: {currentUser.is_verified ? "Yes" : "No"} <br/>
                                        Groups: {currentUser.groups.length == 0 ? "None" : currentUser.groups.toString()}
                                    </p>
                                </div>
                                <div style={{margin: 5,  flex: 1}}>
                                    <p>
                                        Last login: {currentUser.last_login == null ? "Never" : currentUser.last_login}<br/>
                                        Problems: {currentUser.solved_problem.length == 0 ? "None" : currentUser.solved_problem.toString()}
                                    </p>
                                </div>
                            </div>
                        </div>
                    </div>)}


                </div>
            </div>
        </div>
    );
}

export default User;
